&lt;img src="http://cdn.akamai.steamstatic.com/steam/apps/370360/extras/header1.jpg?t=1447374437"&gt;
&lt;br&gt;
&lt;br&gt;TIS-100 is an open-ended programming game by Zachtronics, the creators of SpaceChem and Infinifactory, in which you rewrite corrupted code segments to repair the TIS-100 and unlock its secrets. It’s the assembly language programming game you never asked for!
&lt;br&gt;
&lt;br&gt;&lt;img src="http://cdn.akamai.steamstatic.com/steam/apps/370360/extras/header4.jpg?t=1447374437"&gt;
&lt;br&gt;
&lt;br&gt;The Tessellated Intelligence Systems TIS-100 is a massively parallel computer architecture comprised of non-uniformly interconnected heterogeneous nodes. The TIS-100 is ideal for applications requiring complex data stream processing, such as automated financial trading, bulk data collection, and civilian behavioral analysis.
&lt;br&gt;
&lt;br&gt;&lt;img src="http://cdn.akamai.steamstatic.com/steam/apps/370360/extras/header2.jpg?t=1447374437"&gt;
&lt;br&gt;
&lt;br&gt;Despite its appearances, TIS-100 is a game!
&lt;br&gt;
&lt;br&gt;&lt;ul class="bb_ul"&gt;
&lt;li&gt; Print and explore the TIS-100 reference manual, which details the inner-workings of the TIS-100 while evoking the aesthetics of a 1980’s computer manual!
&lt;br&gt;&lt;/li&gt;&lt;li&gt; Solve more than 45 puzzles, competing against your friends and the world to minimize your cycle, instruction, and node counts. 
&lt;br&gt;&lt;/li&gt;&lt;li&gt; Design your own challenges in the TIS-100’s 3 sandboxes, including a “visual console” that lets you create your own games within the game! 
&lt;br&gt;&lt;/li&gt;&lt;li&gt; Uncover the mysteries of the TIS-100… who created it, and for what purpose? 
&lt;/li&gt;&lt;/ul&gt;
